import React , {Fragment} from 'react';
const CardList = ({ robots }) => {
    const Cardcomponent = robots.map(user => <card name = {robot.name}  id= {user.id} email = {user.email} />)
    return (
        {Cardcomponent}
    );
}
export default CardList
